import styled from 'styled-components';

export default styled.div`
  margin-bottom: 40px;
  border-bottom: 1px solid #f1f1f4;

  h1 {
    color: #2b416c;
    font-family: Roboto;
    font-size: 48px;
    font-weight: bold;
    line-height: 50px;
    margin-bottom: 40px;
  }

  .campaign-button {
    color: #556789;
    font-family: Roboto;
    font-size: 18px;
    line-height: 28px;
    margin-right: 36px;
    padding-bottom: 16px;
    outline: none;
  }

  .selected-button {
    color: #83A515;
    border-bottom: 4px solid #83A515;
  }
`;
